Экспериментальный полёт «Аполлон» — «Союз» (сокр. ЭПАС; другие названия — программа «Союз — Аполлон», программа «Аполлон — Союз»; англ. Apollo–Soyuz Test Project, ASTP), также известен как «рукопожатие в космосе» — программа совместного экспериментального пилотируемого полёта советского космического корабля «Союз-19» и американского космического корабля «Аполлон». Осуществлён 15 июля 1975 года. Программа была утверждена 24 мая 1972 года Соглашением между СССР и США о сотрудничестве в исследовании и использовании космического пространства в мирных целях. Основными целями программы были: 
* испытание элементов совместимой системы сближения на орбите; 
* испытание активно-пассивного стыковочного агрегата; 
* проверка техники и оборудования для обеспечения перехода космонавтов из корабля в корабль; 
* накопление опыта в проведении совместных полётов космических кораблей СССР и США. Кроме этого, программа предполагала изучение возможности управления ориентацией состыкованных кораблей, проверку межкорабельной связи и координации действий советского и американского центров управления полётами.

Експериментальний політ «Аполлон» — «Союз» (ЕПАС, програма «Союз» — «Аполлон»; англ. Apollo-Soyuz Test Project (ASTP)) — програма спільного експериментального польоту радянського космічного корабля «Союз-19» і американського космічного корабля «Аполлон». Програма затверджена 24 травня 1972 року угодою між СРСР та США. Основна мета програми: 
* випробування елементів спільної системи зближення космічних апаратів на орбіті; 
* випробовування стикувальних агрегатів; 
* перевірка техніки та обладнання для переходу космонавтів (астронавтів) з апарата в апарат на орбіті; 
* накопичення досвіду спільних польотів космічних кораблів СРСР та США. Крім того, програма передбачала співпрацю радянського й американського центрів управління польотами, перевірку радіозв'язку між космічними апаратами, вивчення можливості управління орієнтацією космічних кораблів.
